import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useLocation } from 'react-router-dom';
import InputMask from 'react-input-mask';

function EditarLocatario() {
  const location = useLocation();
  const cpfEdit = new URLSearchParams(location.search).get('CPF');

  const [dataNascimento, setDataNascimento] = useState('');
  const [cep, setCep] = useState('');
  const [numero, setNumero] = useState('');
  const [complemento, setComplemento] = useState('');
  const [celular, setCelular] = useState('');
  const [cpf, setCpf] = useState('');

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    try {
      const response = await axios.get(`http://localhost:8080/api/locatarios/search?cpf=${cpfEdit}`);
      const locatario = response.data;

      setDataNascimento(locatario.dataNascimento);
      setCep(locatario.cep);
      setNumero(locatario.numero);
      setComplemento(locatario.complemento);
      setCelular(locatario.celular);
      setCpf(locatario.cpf);
    } catch (error) {
      console.error(error);
    }
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    axios.post('http://localhost:8080/api/editarlocatario', {
      dataNascimento,
      cep,
      numero,
      complemento,
      celular,
      cpf
    })
      .then((response) => {
        console.log(response.data);
      })
      .catch((error) => {
        console.error(error);
      });
  };

  return (
    <div className="EditarLocatario">
      <header className="EditarLocatario-header">
        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <label htmlFor="dataNascimento">Data de Nascimento</label>
            <br />
            <input
              type="date"
              id="dataNascimento"
              className="rounded-input"
              value={dataNascimento}
              onChange={(e) => setDataNascimento(e.target.value)}
            />
          </div>

          <div className="form-group">
            <label htmlFor="cep">CEP</label>
            <br />
            <InputMask
              mask="99999-999"
              type="text"
              id="cep"
              className="rounded-input"
              value={cep}
              onChange={(e) => setCep(e.target.value)}
            />
          </div>

          <div className="form-group">
            <label htmlFor="numero">Número</label>
            <br />
            <input
              type="text"
              id="numero"
              className="rounded-input"
              value={numero}
              onChange={(e) => setNumero(e.target.value)}
            />
          </div>

          <div className="form-group">
            <label htmlFor="complemento">Complemento</label>
            <br />
            <input
              type="text"
              id="complemento"
              className="rounded-input"
              value={complemento}
              onChange={(e) => setComplemento(e.target.value)}
            />
          </div>

          <div className="form-group">
            <label htmlFor="celular">Celular</label>
            <br />
            <input
              type="tel"
              id="celular"
              className="rounded-input"
              value={celular}
              onChange={(e) => setCelular(e.target.value)}
            />
          </div>

          <div className="form-group">
            <label htmlFor="cpf">CPF</label>
            <br />
            <InputMask
              mask="999.999.999-99"
              type="text"
              id="cpf"
              className="rounded-input"
              value={cpf}
              onChange={(e) => setCpf(e.target.value)}
            />
          </div>

          <button type="submit" className="btnCadastrarLocatario">
            Cadastrar Locatário
          </button>
        </form>
      </header>
    </div>
  );
}

export default EditarLocatario;
